import React from "react";

import "./custom-button.css";

const CustomButton = ({ children, ...otherProps }) => {
  return (
    <div className="customButton__container">
      <button {...otherProps} className="custom__buton">
        {children}
      </button>
    </div>
  );
};

export default CustomButton;
